    CreateGlobalAccelerationInstance(query: CreateGlobalAccelerationInstanceRequest): Promise<CreateGlobalAccelerationInstanceResponse>;
    /**
     * 调用CreateHaVip接口创建高可用虚拟IP（HaVip）。
     */
    CreateHaVip(query: CreateHaVipRequest): Promise<CreateHaVipResponse>;
    /**
     * 创建IPv6转换服务实例。
     */
    CreateIPv6Translator(query: CreateIPv6TranslatorRequest): Promise<CreateIPv6TranslatorResponse>;
    /**
     * 创建访问控制策略组。
     */
    CreateIPv6TranslatorAclList(query: CreateIPv6TranslatorAclListRequest): Promise<CreateIPv6TranslatorAclListResponse>;
    /**
     * 为指定的IPv6转换服务实例添加IPv6转换映射条目。
     */
    CreateIPv6TranslatorEntry(query: CreateIPv6TranslatorEntryRequest): Promise<CreateIPv6TranslatorEntryResponse>;
    /**
     * 调用CreateIpsecServer接口创建IPsec服务端。
     */
    CreateIpsecServer(query: CreateIpsecServerRequest): Promise<CreateIpsecServerResponse>;
    /**
     * 您可以通过创建仅主动出规则，使开通了IPv6网段的VPC中的ECS可以主动访问客户端的IPv6终端，但不允许客户端的IPv6终端通过互联网访问VPC网络中的ECS实例，调用CreateIpv6EgressOnlyRule为IPv6地址添加仅主动出规则。
     */
    CreateIpv6EgressOnlyRule(query: CreateIpv6EgressOnlyRuleRequest): Promise<CreateIpv6EgressOnlyRuleResponse>;
    /**
     * IPv6网关是控制专有网络VPC（Virtual Private Cloud）的IPv6网络流量的网关。您可以通过调用CreateIpv6Gateway接口创建IPv6网关。
     */
    CreateIpv6Gateway(query: CreateIpv6GatewayRequest): Promise<CreateIpv6GatewayResponse>;
    /**
     * 调用CreateNatGateway接口创建增强型公网NAT网关或VPC NAT网关。
     */
    CreateNatGateway(query: CreateNatGatewayRequest): Promise<CreateNatGatewayResponse>;
    /**
     * 调用CreateNetworkAcl接口创建网络ACL。
     */
    CreateNetworkAcl(query: CreateNetworkAclRequest): Promise<CreateNetworkAclResponse>;
    /**
     * 调用CreatePhysicalConnectionOccupancyOrder接口创建资源占用费用的订单。
     */
    CreatePhysicalConnectionOccupancyOrder(query: CreatePhysicalConnectionOccupancyOrderRequest): Promise<CreatePhysicalConnectionOccupancyOrderResponse>;
