    DeleteRouterInterface(query: DeleteRouterInterfaceRequest): Promise<DeleteRouterInterfaceResponse>;
    /**
     * 调用DeleteSnatEntry接口删除指定的SNAT条目。
     */
    DeleteSnatEntry(query: DeleteSnatEntryRequest): Promise<DeleteSnatEntryResponse>;
